


# 438. Find All Anagrams in a String

# Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
# Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.
# The order of output does not matter.

# Example 1:

# Input:
# s: "cbaebabacd" p: "abc"
# Output:
# [0, 6]

# Explanation:
# The substring with start index = 0 is "cba", which is an anagram of "abc".
# The substring with start index = 6 is "bac", which is an anagram of "abc".

# Example 2:

# Input:
# s: "abab" p: "ab"
# Output:
# [0, 1, 2]

# Explanation:
# The substring with start index = 0 is "ab", which is an anagram of "ab".
# The substring with start index = 1 is "ba", which is an anagram of "ab".
# The substring with start index = 2 is "ab", which is an anagram of "ab".


class findAnagrams:

    # TLE
    def doit(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if len(s) < len(p):
            return []

        pos = [0]
        data = {}
        for c in p:
            data[c] = data.get(c, 0) + 1
    
        res = []
        for i in range(len(s) - len(p) + 1):
            if s[i] not in data:
                continue

            tmp = data.copy()
            x = 0
            while x < len(p):
                a = x + i
                if s[a] not in tmp:
                    break

                tmp[s[a]] -= 1
                if tmp[s[a]] == 0:
                    del tmp[s[a]]

                x += 1

            if x == len(p):
                res.append(i)

        return res                      
                         

    # <sliding window>
    def doit(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if len(s) < len(p):
            return []
        
        res = []
        pv, sv = [0] * 26, [0] * 26
        # fill pv, vector of counters for pattern string and sv, vector of counters for the sliding window
        for i, c in enumerate(p):
            pv[ord(p[i]) - ord('a')] += 1
            sv[ord(s[i]) - ord('a')] += 1

        if pv == sv:
            res.append(0)

        # here window is moving from left to right across the string. 
        # window size is p.size(), so s.size()-p.size() moves are made 
        for i in range(len(p), len(s)):
            # window extends one step to the right. counter for s[i] is incremented 
            sv[ord(s[i]) - ord('a')] += 1

            # since we added one element to the right, 
            # one element to the left should be forgotten. 
            # counter for s[i-p.size()] is decremented
            sv[ord(s[i - len(p)]) - ord('a')] -= 1

            # if after move to the right the anagram can be composed, 
            # add new position of window's left point to the result
            if pv == sv:
                res.append(i - len(p) + 1)

        return res           



    def doit1(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        p_counts = [0] * 26
        counts = [0] * 26
        s_len = len(s)
        p_len = len(p)

        if p_len > s_len:
            return []

        p_idxs = []
        f = lambda x: ord(x) - 97
        
        for val in map(f, p):
            p_counts[val] += 1

        ord_arr = list(map(f, s))

        for idx in range(p_len):
            counts[ord_arr[idx]] += 1

        if counts == p_counts:
            p_idxs.append(0)

        for idx in range(p_len, s_len):

            counts[ord_arr[idx]] += 1
            counts[ord_arr[idx - p_len]] -= 1

            if counts == p_counts:
                p_idxs.append(idx - p_len + 1)

        return p_idxs            
                    



